import{_ as e,o,c as a,Q as t}from"./chunks/framework.9e21ba36.js";const i="data:image/webp;base64,",s="data:image/webp;base64,",f=JSON.parse('{"title":"Application Note 268 Two Interfaces, Limitless Possibilities","description":"","frontmatter":{},"headers":[],"relativePath":"application-notes/an268.md","filePath":"application-notes/an268.md"}'),r={name:"application-notes/an268.md"},n=t('<hr><h1 id="application-note-268-two-interfaces-limitless-possibilities" tabindex="-1">Application Note 268 <br>Two Interfaces, Limitless Possibilities <a class="header-anchor" href="#application-note-268-two-interfaces-limitless-possibilities" aria-label="Permalink to &quot;Application Note 268 &lt;br&gt;Two Interfaces, Limitless Possibilities&quot;">​</a></h1><hr><p>There are two types of pins on MCxxxx microcontrollers: simple I/O and XBus. Note that they are not interoperable, and can only be connected to another pin of the same type.</p><h2 id="simple-i-o" tabindex="-1">Simple I/O <a class="header-anchor" href="#simple-i-o" aria-label="Permalink to &quot;Simple I/O&quot;">​</a></h2><img src="'+i+'" width="200" alt="Simple IO"><p>Simple I/O values are continuous signal levels from 0 to 100, inclusive. Simple I/O pins are unmarked.</p><p>Simple I/O is used for applications such as connecting a microcontroller to a simple input, such as a button, switch, or microphone, or a simple output, such as an LED, a speaker, or a motor.</p><h2 id="xbus" tabindex="-1">XBus <a class="header-anchor" href="#xbus" aria-label="Permalink to &quot;XBus&quot;">​</a></h2><img src="'+s+'" width="200" alt="XBus"><p>XBus values are discrete data packets from -999 to 999, inclusive. XBus pins are marked with a yellow dot.</p><p>XBus is commonly used to transmit data between two microcontrollers or a microcontroller and complex input or output, such as a keypad or numeric display.</p><h2 id="simple-i-o-vs-xbus-behavior" tabindex="-1">Simple I/O vs. XBus Behavior <a class="header-anchor" href="#simple-i-o-vs-xbus-behavior" aria-label="Permalink to &quot;Simple I/O vs. XBus Behavior&quot;">​</a></h2><p>Simple I/O pins can be read or written at any time with no regard to the state of connected devices.</p><p>XBus, however, is a synchronized protocol. Data over XBus pins is only transferred when there is <strong>both a reader attempting to read and a writer attempting to write</strong>. If a read or write is attempted without a corresponding operation on a connected device, the operation will block.</p>',15),l=[n];function c(p,d,A,m,u,h){return o(),a("div",null,l)}const w=e(r,[["render",c]]);export{f as __pageData,w as default};
